import React from 'react';
import IC3 from './images/IC3.jpg';
import IC5 from './images/IC5.jpg';
import IC6 from './images/IC6.jpg';

function Footer() {
  const imageFiles = [IC3, IC5, IC6];
  return (
    <div className="flex items-end gap-3">
      {imageFiles.map((image, i) => (
        <a href="#" target="_blank" className="w-10 h-10 mx-2">
          <img src={image} key={i} alt="image" className="rounded-full w-full h-full object-cover" />
        </a>
      ))}
    </div>
  );
}

export default Footer;
